import React from "react";
import Carousel from "react-responsive-carousel";
import styled from "styled-components";

function ThirdPage() {
  return (
    <Container>
      <Carousel>
        <div>
          <img src="/images/model-s/tesla-steering.jpg" alt="" />
        </div>
        <div>
          <img src="/images/model-s/screen.jpg" alt="" />
        </div>
        <div>
          <img src="/images/model-s/witcher.jpg" alt="" />
        </div>
        <div>
          <img src="/images/model-s/seats.jpg" alt="" />
        </div>
      </Carousel>
    </Container>
  );
}

const Container = styled.div`
  height: 100vh;
  background: rgb(0, 0, 0);
`;
export default ThirdPage;
